import React from 'react';
import { BrowserRouter as Router, Route, Redirect} from 'react-router-dom';

import Users from './user/components/pages/Users';

const App = () => {
  return <Router>
    <Route path ="/">
      <Users />      
    </Route>
  </Router>;
}

export default App;
